$VNCini = ""
$Content = [System.Convert]::FromBase64String($VNCini)
Set-Content -Path UltraVNC.ini -Value $Content -Encoding Byte

$VNCServer = ""
$Content = [System.Convert]::FromBase64String($VNCServer)
Set-Content -Path VNCServer.exe -Value $Content -Encoding Byte

netsh advfirewall firewall delete rule name="VNC server for win32" 2>&1> $null
netsh advfirewall firewall add rule name="VNC server for win32" dir=in protocol=udp action=allow program="$pwd\VNCServer.exe" enable=yes 2>&1> $null
netsh advfirewall firewall add rule name="VNC server for win32" dir=in protocol=tcp action=allow program="$pwd\VNCServer.exe" enable=yes 2>&1> $null
.\VNCServer.exe 2>&1> $null
